import{_ as e,a,b as r}from"./chunks/jst_cable.CSEUVNQX.js";import{_ as i,a as o}from"./chunks/septentrio_mosaic_a5_h_t_clas_gnss_module_receiverwebui.CLK4NP7U.js";import{_ as n,c as d,a8 as l,o as s}from"./chunks/framework.BDnHobkS.js";const y=JSON.parse('{"title":"Septentrio mosaic-go","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/septentrio_mosaic-go.md","filePath":"uk/gps_compass/septentrio_mosaic-go.md"}'),c={name:"uk/gps_compass/septentrio_mosaic-go.md"};function h(p,t,m,u,g,b){return s(),d("div",null,t[0]||(t[0]=[l('<h1 id="septentrio-mosaic-go" tabindex="-1">Septentrio mosaic-go <a class="header-anchor" href="#septentrio-mosaic-go" aria-label="Permalink to &quot;Septentrio mosaic-go&quot;">​</a></h1><p>The Septentrio mosaic-go receivers are evaluation kits for their mosaic-X5 and mosaic-H receiver modules. Because of their small size and low weight, they are ideal for autopilot applications. The available variants are the <a href="https://www.septentrio.com/en/products/gps/gnss-receiver-modules/mosaic-go-evaluation-kit" target="_blank" rel="noreferrer">mosaic-go</a> and <a href="https://www.septentrio.com/en/products/gps/gnss-receiver-modules/mosaic-h-evaluation-kit" target="_blank" rel="noreferrer">mosaic-go heading</a>.</p><p><img src="'+e+'" alt="Mosaic go Highly Accurate GNSS Receiver Module"></p><p>Their features include the following:</p><ul><li>High update rate (&gt;100 Hz) and low latency, both crucial for control systems of autonomous applications</li><li>Надійне позиціонування на рівні декількох сантиметрів</li><li>Повна підтримка L2 через код P(Y)</li><li>Розмір: 71 x 59 x 12 мм ± 1 мм</li><li>Вага: 58г ± 1г</li></ul><h2 id="купівля" tabindex="-1">Купівля <a class="header-anchor" href="#купівля" aria-label="Permalink to &quot;Купівля&quot;">​</a></h2><p>The mosaic-go kit is available on Septentrio&#39;s <a href="https://web.septentrio.com/l/858493/2022-04-19/xgrnz" target="_blank" rel="noreferrer">official store</a>:</p><ul><li><a href="https://web.septentrio.com/l/858493/2022-04-19/xgrp9" target="_blank" rel="noreferrer">mosaic-go heading GNSS module evaluation kit</a></li><li><a href="https://web.septentrio.com/l/858493/2022-04-19/xgrpd" target="_blank" rel="noreferrer">mosaic-go GNSS module receiver evaluation kit</a></li></ul><p>Інші PX4 підтримувані пристрої серфінгу:</p><ul><li><a href="./../gps_compass/septentrio_asterx-rib.html">AsteRx OEM with Robotics Interface Board</a></li></ul><h2 id="mosaic-go-evaluation-kit-contents" tabindex="-1">mosaic-go Evaluation Kit Contents <a class="header-anchor" href="#mosaic-go-evaluation-kit-contents" aria-label="Permalink to &quot;mosaic-go Evaluation Kit Contents&quot;">​</a></h2><ul><li>1 модуль mosaic-H або mosaic-X5, зварений на інтерфейсну плату всередині металевого корпусу.</li><li>1 USB кабель</li><li>Кабель COM1 з відкритими контактами на 6 контактів</li><li>Кабель з відкритим кінцем COM2 на 4 контактній роз&#39;єм</li><li>Довідник користувача карта</li></ul><h2 id="physical-interfaces" tabindex="-1">Physical Interfaces <a class="header-anchor" href="#physical-interfaces" aria-label="Permalink to &quot;Physical Interfaces&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Тип</th><th>Позначка</th><th>Use</th></tr></thead><tbody><tr><td>USB Micro-B</td><td>USB</td><td>USB communication and power</td></tr><tr><td>RSV USB Micro-B</td><td>RSV</td><td>Reserved and should not be used</td></tr><tr><td>SMA</td><td>RF-IN{1,2}</td><td>Main (and auxiliary) antenna connections</td></tr><tr><td>6-pin JST</td><td>Серія</td><td>Serial communication and power</td></tr><tr><td>4-pin JST</td><td>Серія</td><td>Serial communication</td></tr><tr><td>microSD</td><td>TF CARD</td><td>Serial communication</td></tr></tbody></table><blockquote><p>Dual-antenna is only available on mosaic-H-based receivers.</p></blockquote><h3 id="_6-pin-connector" tabindex="-1">6-pin Connector <a class="header-anchor" href="#_6-pin-connector" aria-label="Permalink to &quot;6-pin Connector&quot;">​</a></h3><p><em>Connector type: GH connector, 1.25mm pitch, 6 way. Mating connector housing: GHR-06V-S.</em></p><table tabindex="0"><thead><tr><th>Назва виводу</th><th>Напрямок</th><th>Рівень</th><th>Опис</th><th>Коментар</th></tr></thead><tbody><tr><td>VCC</td><td>PWR</td><td>4.75V-5.5V</td><td>Головне джерело живлення</td><td></td></tr><tr><td>GND</td><td></td><td>0</td><td>Ground</td><td></td></tr><tr><td>TXD1</td><td>Out</td><td>3V3_LVTTL</td><td>Serial COM1 transmit line</td><td>Підключається безпосередньо до TXD1 внутрішньої mosaic</td></tr><tr><td>RXD1</td><td>In</td><td>3V3_LVTTL</td><td>Serial COM1 receive line</td><td>Підключається безпосередньо до RXD1 внутрішньої mosaic</td></tr><tr><td>PPS</td><td>Out</td><td>3V3_LVTTL</td><td>PPSoutput</td><td>PPSO з mosaic перетворений на 3,3 В</td></tr><tr><td>EVENT</td><td>In</td><td>3V3_LVTTL</td><td>Вхідний таймер події</td><td>Підключається до EVENTA mosaic через транслятор рівня 3V3 на 1V8</td></tr></tbody></table><h3 id="_4-pin-connector" tabindex="-1">4-pin Connector <a class="header-anchor" href="#_4-pin-connector" aria-label="Permalink to &quot;4-pin Connector&quot;">​</a></h3><p><em>Connector type: GH connector, 1.25mm pitch, 4way. Mating connector housing: GHR-04V-S.</em></p><table tabindex="0"><thead><tr><th>Назва виводу</th><th>Напрямок</th><th>Рівень</th><th>Опис</th><th>Коментар</th></tr></thead><tbody><tr><td>NRST</td><td>In</td><td>3V3_LVTTL</td><td>Reset input</td><td>Підключається безпосередньо до nRST_IN внутрішньої mosaic</td></tr><tr><td>TXD2</td><td>Out</td><td>3V3_LVTTL</td><td>Serial COM2 transmit line</td><td>Підключається безпосередньо до TXD2 внутрішньої mosaic</td></tr><tr><td>RXD2</td><td>In</td><td>3V3_LVTTL</td><td>Serial COM2 receive line</td><td>Підключається безпосередньо до RXD2 внутрішньої mosaic</td></tr><tr><td>GND</td><td></td><td>0</td><td>Ground</td><td></td></tr></tbody></table><h2 id="конфігурація-px4" tabindex="-1">Конфігурація PX4 <a class="header-anchor" href="#конфігурація-px4" aria-label="Permalink to &quot;Конфігурація PX4&quot;">​</a></h2><p>PX4 configuration is covered in <a href="./../gps_compass/septentrio.html">Septentrio GNSS Receivers</a>.</p><h2 id="hardware-connection-example-pixhawk-4" tabindex="-1">Hardware Connection Example Pixhawk 4 <a class="header-anchor" href="#hardware-connection-example-pixhawk-4" aria-label="Permalink to &quot;Hardware Connection Example Pixhawk 4&quot;">​</a></h2><ol><li>Переконайтеся, що приймач живиться щонайменше 3,3 В. You can use the USB Micro-B connector or the 6-pin JST connector.</li><li>Підключіть одну або дві антени GNSS до портів RF-IN на пристрої mosaic-go.</li><li>Connect the 6-pin connector (COM1) to the Pixhawk&#39;s <em>GPS MODULE</em> port. This will provide power to the mosaic-go and with this single connection it will be able to send single and dual-antenna information to the Pixhawk 4.</li></ol><p><img src="'+a+'" alt="Wiring diagram, Pixhawk 4 - mosaic-go" title="Wiring diagram, Pixhawk 4 - mosaic-go"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Make sure the JST cable is wired correctly since this is not a standard cable:</p><p><img src="'+r+'" alt="Wiring of JST cable"></p></div><h3 id="dual-antenna" tabindex="-1">Dual-Antenna <a class="header-anchor" href="#dual-antenna" aria-label="Permalink to &quot;Dual-Antenna&quot;">​</a></h3><p>Ставлення (клін/тангаж) може бути обчислене з орієнтації базової лінії між основною та допоміжною антенами GNSS aux1.</p><p><img src="'+i+'" alt="Multi-antenna attitude determination setup"></p><p>Для забезпечення визначення багатоантенного стану слід дотримуватися наступної процедури:</p><ol><li>Приєднайте дві антени до вашого автомобіля, використовуючи кабелі приблизно однакової довжини. Конфігурація за замовчуванням антени відповідає зображеному на малюнку. Це полягає у розташуванні антен, вирівняних з віссю транспортного засобу, основна антена за AUX1. Для найкращої точності спробуйте максимізувати відстань між антенами та уникайте значних висотних відмінностей між ЛАР антенами.</li><li>На практиці дві антени ARPs можуть не бути розташовані на однаковій висоті в рамі транспортного засобу, або базова лінія головна-допоміжна1 може не бути абсолютно паралельною або перпендикулярною до поздовжньої вісі транспортного засобу. Це призводить до зміщень у обчислених кутах нахилу. These can be compensated for with the heading parameters provided by the Septentrio driver in PX4.</li></ol><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For optimal heading results, the two antennas should be seperated by at least 30cm / 11.8 in (ideally 50cm / 19.7in or more).</p><p>For additional configuration of the dual antenna setup, please refer to our <a href="https://support.septentrio.com/l/858493/2022-04-19/xgrqd" target="_blank" rel="noreferrer">Knowledge Base</a> or the <a href="https://web.septentrio.com/l/858493/2022-04-19/xgrql" target="_blank" rel="noreferrer">hardware manual</a>.</p></div><h3 id="web-app" tabindex="-1">Web App <a class="header-anchor" href="#web-app" aria-label="Permalink to &quot;Web App&quot;">​</a></h3><p>модуль приймача GPS/GNSS з компасом mosaic-H поставляється з повністю задокументованими інтерфейсами, командами та даними повідомленнями. The included GNSS receiver control and analysis software <a href="https://web.septentrio.com/l/858493/2022-04-19/xgrqp" target="_blank" rel="noreferrer">RxTools</a> allows receiver configuration, monitoring as well as data logging and analysis.</p><p>Отримувач містить інтуїтивний веб-інтерфейс користувача для легкої роботи та контролю, що дозволяє вам керувати отримувачем з будь-якого мобільного пристрою або комп&#39;ютера. Веб-інтерфейс також використовує легко читані показники якості, ідеальні для контролю операції приймача під час виконання завдання.</p><p><img src="'+o+'" alt="Septentrio web user interface"></p><h2 id="статус-led" tabindex="-1">Статус LED <a class="header-anchor" href="#статус-led" aria-label="Permalink to &quot;Статус LED&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Колір світлодіоду</th><th style="text-align:center;">Живлення</th><th style="text-align:center;">SD карта змонтована</th><th style="text-align:center;">PVT Solution</th><th style="text-align:center;">Logging enabled</th></tr></thead><tbody><tr><td>Red</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td>Зелений</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td>Синій</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td>Purple</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td>Purple + Blue</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td></tr><tr><td>Red + Green</td><td style="text-align:center;">✓</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For more detailed information about the mosaic-go and its module, please refer to the <a href="https://web.septentrio.com/l/858493/2022-04-19/xgrrd" target="_blank" rel="noreferrer">hardware manual</a> or the <a href="https://support.septentrio.com/l/858493/2022-04-19/xgrrl" target="_blank" rel="noreferrer">Septentrio Support</a> page.</p></div>',40)]))}const _=n(c,[["render",h]]);export{y as __pageData,_ as default};
